"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[404],{197:e=>{e.exports=JSON.parse('{"functions":[],"properties":[],"types":[{"name":"List<T>","desc":"Represents a simple ordered array of items, essentially an alias of {[number]:T} (or {T}).\\r","lua_type":"{[number]:T }","source":{"line":10,"path":"src/ServerScriptService/Services/TowerLoaderService/Types.luau"}},{"name":"Dictionary<T>","desc":"Same as `List<T>`, but uses `string` indexes instead of `number` indexes.\\r","lua_type":"{[string]:T}","source":{"line":15,"path":"src/ServerScriptService/Services/TowerLoaderService/Types.luau"}},{"name":"PlayerInfo","desc":"","fields":[{"name":"Player","lua_type":"Player","desc":"A reference to the actual player instance in the **Players** service that this **PlayerInfo** is related to."},{"name":"GameTimer","lua_type":"number","desc":"In seconds, how long the player has been in the game. This value is floored and sent to the leaderboard every second for the **\u201cTime\u201d** statistic."},{"name":"LastRestart","lua_type":"number","desc":"How many seconds has passed since the player has last restarted a tower. This property is necessary for making sure they can\u2019t lag out the server by imposing a cool-down. This cool-down duration can be changed in the game config via the **RestartCooldown**."},{"name":"CurrentTower","lua_type":"string","desc":"The ID of the tower the player is currently playing. If the player is not in a tower, this value will be blank."},{"name":"CurrentTowerCheckpoint","lua_type":"number","desc":"The index of the checkpoint the player is currently assigned to touch. Every time the appropriate checkpoint is touched, this value increments. If the referenced checkpoint does not exist, no checkpoint checks are done. If a player equips any debug items, this value is set to *math.huge*."},{"name":"BoostItemsUsed","lua_type":"boolean","desc":"Tracks whether or not a boost item has been used in a tower or tower rush. Whenever a player loads in a tower, this value is reset to false, but the moment they equip a boost item, this value is set to true."},{"name":"TowerTimer","lua_type":"number","desc":"In seconds, how long the player has been in a tower or tower rush. This value does not increment if the **CurrentTower** is blank; In other words, not currently in a tower. Although the client also keeps time for the same reason on it\u2019s own, this value is sent to the client every 2 seconds to prevent the client\u2019s timer from desynchronizing with the server\u2019s timer."},{"name":"CurrentTowerRush","lua_type":"string","desc":"The ID of the tower rush the player is currently playing. If the player is not in a tower rush, this value will be blank. This value should ideally only be set if **CurrentTower** is also set."},{"name":"CurrentTowerRushIndex","lua_type":"number","desc":"The index of the current tower the player is at in the tower rush."},{"name":"TouchEventBusy","lua_type":"boolean","desc":"This boolean is used internally by various callbacks as a debounce for touch events."},{"name":"IsLoadingTower","lua_type":"boolean","desc":"This boolean is used as a debounce for tower loading. This property is set to true when a tower begins loading and reverts to false when it is finished. The loading of a tower cannot be initialized while this property is true."},{"name":"HasEverpresentCOs","lua_type":"boolean","desc":"This boolean is used to determine if the player has already been sent ever-present client objects. If this value is true, the client\u2019s requests for ever-present COs will be rejected to prevent malicious users from lagging out the server."}],"source":{"line":33,"path":"src/ServerScriptService/Services/TowerLoaderService/Types.luau"}},{"name":"EndingInfo","desc":"","fields":[{"name":"Name","lua_type":"string","desc":"The proper, human-readable name of this ending."},{"name":"Difficulty","lua_type":"string","desc":"The name of the difficulty classification of this specific ending, it must be the name of a difficulty defined in **GameData.Difficulties**. Otherwise, a **default** difficulty will be used instead when obtaining the **Difficulty** info."},{"name":"BadgeID","lua_type":"number","desc":"The ID of the badge to be awarded when this ending is triggered. If this value is set to 0, no badge will be awarded. Furthermore, this badge is separate from the tower\u2019s badge, so if a tower\u2019s badge, as well as this ending\u2019s badge are both set, both badges will be awarded at the same time."},{"name":"PreventTowerBadge","lua_type":"boolean","desc":"As mentioned above, both the tower badge and this ending\u2019s own badge are awarded at the same time. However, if you want to suppress the tower badge from being awarded, enable this property."},{"name":"ParentTower","lua_type":"string","desc":"The ID of the tower this ending belongs to."},{"name":"WinroomMarker","lua_type":"string","desc":"The name of the marker the player should teleport to when this ending is triggered. If omitted, it the player will be teleported to the **WinroomSpawn**."}],"source":{"line":60,"path":"src/ServerScriptService/Services/TowerLoaderService/Types.luau"}},{"name":"TowerInfo","desc":"","fields":[{"name":"Name","lua_type":"string","desc":"The full, human-readable name of the tower. For example, if you have a tower folder named \u201cToH\u201d, an appropriate value for this property would be \u201cTower of Hecc\u201d."},{"name":"Difficulty","lua_type":"string","desc":"The name of the difficulty classification of this tower, it must be the name of a difficulty defined in **GameData.Difficulties**. Otherwise, a \u201cdefault\u201d difficulty will be used instead when obtaining the **Difficulty** info."},{"name":"BadgeID","lua_type":"number","desc":"The ID of the badge to award the player upon beating this tower. If the value is 0, no badge will be awarded."},{"name":"Folder","lua_type":"Instance","desc":"A reference to the folder representing the tower in the workspace. The name of this folder will be used as the internal ID for this tower."},{"name":"SpawnLocation","lua_type":"BasePart","desc":"A reference to the part representing the position where the player should spawn upon entering the tower. Do not use an actual SpawnLocation, as it isn\u2019t necessary and is prone to breaking the game, just use a regular part."},{"name":"ClientObjects","lua_type":"Instance?","desc":"A reference to the folder containing the tower\u2019s client objects. If the tower does not contain a ClientSidedObjects folder, this property will be set to nil, and the tower will be marked as \u201cPurist\u201d."},{"name":"Endings","lua_type":"Dictionary<EndingInfo>","desc":"A dictionary of endings for this tower. The string keys represent the names of the endings, while the values contain information about the endings."},{"name":"MinimumTime","lua_type":"number","desc":"The minimum amount of time (measured in seconds) that the player must spend in a tower before they can touch the winpad, otherwise, they will be kicked from the game. Setting this value to 0 effectively disables this measure."},{"name":"Checkpoints","lua_type":"List<BasePart>","desc":"An ordered list of checkpoints, that must be touched by the player\u2019s pivot point in order to complete the tower. Failing to touch each checkpoint will result in the player being kicked."},{"name":"CheckpointCount","lua_type":"number","desc":"Describes how many checkpoints the tower has. This property is figured out automatically and is used internally."}],"source":{"line":83,"path":"src/ServerScriptService/Services/TowerLoaderService/Types.luau"}},{"name":"TowerRush","desc":"","fields":[{"name":"BadgeID","lua_type":"number","desc":"The ID of the badge to award the player upon beating this tower. If the value is 0, no badge will be awarded."},{"name":"Title","lua_type":"string","desc":"The full, human-readable name of the tower. For example, if you have a tower folder named \u201cToH\u201d, an appropriate value for this property would be \u201cTower of Hecc\u201d."},{"name":"Difficulty","lua_type":"string","desc":"The name of the difficulty classification of this specific ending, it must be the name of a difficulty defined in **GameData.Difficulties**. Otherwise, a **default** difficulty will be used instead when obtaining the **Difficulty** info."},{"name":"WinroomMarker","lua_type":"string","desc":"The name of the marker the player should teleport to when this ending is triggered. If omitted, it the player will be teleported to the **WinroomSpawn**."},{"name":"Towers","lua_type":"List<string>","desc":"A list of every tower that the player must progress through in the tower rush, in order of progression."}],"source":{"line":105,"path":"src/ServerScriptService/Services/TowerLoaderService/Types.luau"}},{"name":"DifficultyInfo","desc":"","fields":[{"name":"Rating","lua_type":"number","desc":"The difficulty\u2019s baseline represented as a number. In JToH, Easy is 1, and Catastrophic is 11."},{"name":"Title","lua_type":"string","desc":"The proper name of this difficulty. If the ID name of this difficulty is \u201cATrulyHardDifficulty\u201d, a good title would be \u201cA Truly Hard Difficulty\u201d."},{"name":"FancyFont","lua_type":"boolean","desc":"Determines if 20pt Bodoni should be used as the font when displaying a win message, instead of the standard 18pt Source Sans Bold. In JToH, Bodoni font win messages are used for Catastrophic difficulty and above."},{"name":"Color","lua_type":"Color3","desc":"The color of this difficulty, normally used for win messages."},{"name":"GlobalAnnouncement","lua_type":"boolean","desc":"If set to true, victors of any tower/tower rush of this difficulty will have their win messages broadcast throughout the entire game, on other servers."}],"source":{"line":122,"path":"src/ServerScriptService/Services/TowerLoaderService/Types.luau"}}],"name":"Types","desc":"MTK makes extensive use of Luau\u2019s type definitions to organize data, many of which act as data structures for various types of objects. This section of the document focuses on documenting every property of these structures; As well as describing other types that may be present in the scripts.\\nAlmost every custom type used by MTK can be found in `MultiTowerServer.Types`. Furthermore, because of how extensively MTK makes use of type annotations, it is recommended that you at least have a basic understanding of [Roblox Luau type annotating](https://luau.org/typecheck).","source":{"line":6,"path":"src/ServerScriptService/Services/TowerLoaderService/Types.luau"}}')}}]);